import React from 'react';

const Skills = () => {
  const skills = [
    { name: 'HTML', icon: 'fab fa-html5', tooltip: 'Standard markup language for creating structured web content.' },
    { name: 'CSS', icon: 'fab fa-css3-alt', tooltip: 'Used to style HTML elements and control visual layout.' },
    { name: 'JavaScript', icon: 'fab fa-js-square', tooltip: 'Adds interactivity and dynamic behavior to web pages.' },
    { name: 'Python', icon: 'fab fa-python', tooltip: 'General-purpose programming language known for simplicity and versatility.' },
    { name: 'Flutter', icon: 'fas fa-mobile-alt', tooltip: 'Framework for building cross-platform mobile apps.' },
    { name: 'Java', icon: 'fab fa-java', tooltip: 'Popular object-oriented language used in enterprise applications.' },
    { name: 'C', icon: 'fas fa-code', tooltip: 'Powerful language used in system programming and embedded systems.' },
    { name: 'SQL', icon: 'fas fa-database', tooltip: 'Structured Query Language for managing relational databases.' },
    { name: 'PHP', icon: 'fab fa-php', tooltip: 'Server-side scripting language mainly used for web development.' },
    { name: 'Shell', icon: 'fas fa-terminal', tooltip: 'Used for command-line scripting and automation in Unix/Linux.' }
  ];

  return (
    <section id="skills" className="card">
      <h2>My Skills</h2>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div key={index} className="skill-item">
            <i className={skill.icon}></i>
            <p>{skill.name}</p>
            <div className="tooltip">{skill.tooltip}</div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
